import React from "react";
import Typography from "@material-ui/core/Typography";
import { jsxDecorator } from "storybook-addon-jsx";
import { Paper, Divider, Grid } from "@material-ui/core";
import { makeStyles, MuiThemeProvider } from "@material-ui/core/styles";
import { storiesOf } from "@storybook/react";
import { muiTheme } from "storybook-addon-material-ui";
import themes from "../../Theme/themes";
import Theme from "../../Theme";
import Box from "../Box";

const useStyles = makeStyles((theme) => ({
    root: {
        boxShadow: theme.shadows[24],
        margin: "20px",
        padding: "20px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        margin: "20px",
        padding: "20px",
    },
}));

export const DefaultBox = ({ label, mode, brand }) => {
    const classes = useStyles();

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="box">
                <Typography variant="h3">Box</Typography>
                <br />
                <Divider />
                <br />

                <Grid container spacing={2}>
                    <Box>{label}</Box>
                </Grid>
            </Paper>
        </MuiThemeProvider>
    );
};

storiesOf("Components/Box", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .addDecorator(muiTheme([Theme]))
    .addDecorator(jsxDecorator)
    .add("Default ", (args) => <DefaultBox {...args} />,
        {
            args: {
                label: "Texto Box",
                brand: "CVC",
                mode: "root"
            },
            argTypes: {
                label: { type: "string" },
                brand: {
                    type: "select",
                    options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
                },
                mode: {
                    type: "select",
                    options: ["root", "darkBg"]
                }
            }
        });
